pragma solidity ^0.7.3;
pragma experimental ABIEncoderV2;

import './ERC721Token.sol';

contract CryptoFantom is ERC721Token {
    struct Fantom {
        uint id;
        uint generation;
        uint geneA;
        uint geneB;
    }
    mapping(uint => Fantom) public fantoms;
    uint public nextId;
    address public admin;

    constructor(
        string memory _tokenURIBase
    ) ERC721Token( _tokenURIBase) public {
        admin = msg.sender;
    }

    function getAllFantoms() external view returns(Fantom[] memory) {
      Fantom[] memory _fantoms = new Fantom[](nextId);
      for(uint i = 0; i < _fantoms.length; i++) {
        _fantoms[i] = fantoms[i];
      }
      return _fantoms;
    }

    function getAllFantomsOf(address owner) external view returns(Fantom[] memory) {
      uint length;
      for(uint i = 0; i < nextId; i++) {
        if(ownerOf(i) == owner) {
          length++;
        }
      }
      Fantom[] memory _fantoms = new Fantom[](length);
      for(uint i = 0; i < _fantoms.length; i++) {
        if(ownerOf(i) == owner) {
          _fantoms[i] = fantoms[i];
        }
      }
      return _fantoms;
    }

    function breed(uint fantom1Id, uint fantom2Id) external {
        require(fantom1Id < nextId && fantom2Id < nextId, 'The 2 fantoms must exist');
        Fantom storage fantom1 = fantoms[fantom1Id];
        Fantom storage fantom2 = fantoms[fantom2Id];
        require(ownerOf(fantom1Id) == msg.sender && ownerOf(fantom2Id) == msg.sender, 'msg.sender must own the 2 fantoms');
        uint baseGen = fantom1.generation > fantom2.generation ? fantom1.generation : fantom2.generation;
        uint geneA = _random(4) > 1 ? fantom1.geneA : fantom2.geneA;
        uint geneB = _random(4) > 1 ? fantom1.geneB : fantom2.geneB;
        fantoms[nextId] = Fantom(nextId, baseGen + 1, geneA ,geneB) ;
        _mint(msg.sender, nextId);
        nextId++;
    }

    function mint() external {
        require(msg.sender == admin, 'only admin');
        fantoms[nextId] = Fantom(nextId, 1, _random(10), _random(10));
        _mint(msg.sender, nextId);
        nextId++;
    }

    function _random(uint max) internal view returns(uint) {
        return uint(keccak256(abi.encodePacked(block.timestamp, block.difficulty))) % max;
    }
}
